import SwiperMain from '../body/SwiperMain';

const Home = () => {
  return (
    <>
      <SwiperMain></SwiperMain>
      <div>
        <h2>Home Page</h2>
        <p>This is the about page content.</p>
      </div>
    </>
  );
};

export default Home;
